import React from 'react';
import ReactDOM from 'react-dom';
import {MemoryRouter, HashRouter, BrowserRouter} from 'react-router-dom'
import App from './App/App';
import * as serviceWorker from './serviceWorker';
import "bootstrap/dist/css/bootstrap.min.css";
import "./sass/main.scss";

// Test
import RouteAnimation from './App/Example/RouteAnimationExample/RouteAnimationExample';
import TransitionExample from './App/Example/RouteAnimationExample/TransitionExample';


ReactDOM.render(
    <HashRouter>
    {/* <App /> */}
    {/* <RouteAnimation /> */}
    <TransitionExample />
    </HashRouter>, 
    document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
